import React from 'react'
import AuthForm from './AuthForm'

const Auth = () => {
  return (
    <div>
    const getData =(data)={
      console.log("Auth ", data)
    };
    return(<div>
      <AuthForm onSubmit={getData}/>
    </div>
  )
  </div>
  )
}

export default Auth
